import subprocess
import sys
import os
import threading
import itertools
import time

required_modules = [
    "colorama",
    "requests",
    "pycryptodome",
    "dnspython"
]

class Spinner:
    def __init__(self, message="Pr√©paration de l'environnement... "):
        self.spinner = itertools.cycle(['|', '/', '-', '\\'])
        self.running = False
        self.thread = None
        self.message = message
        self.displayed_message = False

    def start(self):
        self.running = True
        self.thread = threading.Thread(target=self._spin)
        self.thread.start()

    def _spin(self):
        while self.running:
            if not self.displayed_message:
                sys.stdout.write(f"\r{self.message}{next(self.spinner)}")
                sys.stdout.flush()
                self.displayed_message = True
            else:
                sys.stdout.write(f"\r{next(self.spinner)}")
                sys.stdout.flush()
            time.sleep(0.1)

    def stop(self):
        self.running = False
        if self.thread:
            self.thread.join()
        sys.stdout.write('\rEnvironnement pr√™t !           \n')
        sys.stdout.flush()

def install_missing_modules(modules):
    installed_any = False
    spinner = Spinner()
    try:
        for module in modules:
            try:
                __import__(module)
            except ImportError:
                if not installed_any:
                    spinner.start()
                    installed_any = True
                with open(os.devnull, 'w') as devnull:
                    subprocess.check_call(
                        [sys.executable, "-m", "pip", "install", module],
                        stdout=devnull,
                        stderr=devnull
                    )
        if installed_any:
            spinner.stop()
    except KeyboardInterrupt:
        spinner.stop()
        print("\n[!] L'installation a √©t√© interrompue.")
    except Exception as e:
        spinner.stop()
        print(f"\n[!] Une erreur est survenue pendant l'installation: {str(e)}")

install_missing_modules(required_modules)

